  align-items: center;
}

.nav-mobile__button {
  cursor: pointer;
  margin-right: 40px;
  padding: 0;
  background: none;
  border: none;
  @media (min-width: 1201px) {
    display: none;
    cursor: none;
  }

  @media (max-width: 576px) {
    margin-right: 24px;
  }
}

.header__logo {
  position: relative;
  z-index: 5;
  width: 81px; 
  height: 25px;
  @media (max-width: 1200px) {
    width: 80px;
  }
}

.header__menu {
  display: flex;
  margin: 0 auto 0 40px;
  @media (max-width: 1200px) {
    display: none;
  }
}

.menu__item {
  display: flex;
  align-items: center;
  vertical-align: baseline;
  margin-left: 24px;
}

.menu__item:hover {
  cursor: pointer;
  filter: invert(44%) sepia(55%) saturate(5788%) hue-rotate(6deg) brightness(109%) contrast(102%);
}

.menu__text {
  margin: 0 4px 0 0;
  color: $typography-body;
  font-weight: 500;
  font-size: 14px;
  line-height: 24px;
}

.menu__link {
  text-decoration: none;
}

.header__button {
  margin-left: auto;
}

.button {
  cursor: pointer;
  border-radius: 6px;
}

.button_primary {
  padding: 8px 20px;
  background-color: $orange;
  color: $white;
  font-weight: 600;
  font-size: 14px;
  line-height: 24px;
  border: 1px solid $orange;
}

.button_primary:hover {
  opacity: 0.8;
}

.button_outline_header {
  margin-right: 16px;
  padding: 8px 20px;
  background-color: rgba(0, 0, 0, 0);
  border: 1px solid #ccc;
  font-weight: 500;
  font-size: 14px;
  line-height: 24px;
  &:hover {
    color: $orange;
    border: 1px solid $orange;
    opacity: 0.8;
  }
  @media (max-width: 576px) {
    display: none;
  }
}

.home-screen {
  display: flex;
  justify-content: space-between;
  align-items: center;
  vertical-align: middle;
  box-sizing: border-box;
  max-width: 1344px;
  margin: 170px auto 0;
  padding: 0 16px;
}

.title {
  margin: 0 0 24px;
  font-weight: 700;
  font-size: 60px;
  line-height: 64px;
  color: $typography-headings;
}

.title_primary {
  @media (max-width: 600px){
    font-weight: 700;
    font-size: 36px;
    line-height: 48px;
  }
}

.home-screen-content__text {
  margin: 0 0 48px ;
  max-width: 430px;
  color: $typography-body;
  font-weight: 400;
  font-size: 18px;
  line-height: 32px;
  @media (max-width: 600px) {
    max-width: 328px;
    font-weight: 400;
    font-size: 16px;
    line-height: 28px;
  }
}

.button_arrow-right {
  display: flex;
  justify-content: space-between;
  width: 256px;
  align-items: center;
  padding: 16px 10px 16px 24px;
  font-weight: 600;
  font-size: 18px;
  line-height: 24px;
  background-color: $orange;
  color: $white;
  border: 1px solid $orange;
  &:hover {
    opacity: 0.8;
  }
}

.home-screen__img {
  position: relative;
  left: -15%;
  top: 3.75%;
  bottom: 3.75%;
  @media (max-width: 1200px) {
    width: 328px;
    height: 304px;;
    left: -8%;
  }

  @media (max-width: 900px) {
    display: none;
  }

}

.partners {
  margin-top: 96px;
  max-height: 80px;
  overflow: hidden;
  @media (max-width: 600px) {
    max-height: 240px;
  } 
}

.partners__banner {
  width: 5000px;
  position: relative;
  animation-name: partners__animation;
  animation-duration: 16s;
  animation-iteration-count: infinite;
  @media (max-width: 600px) {
    width: 900px
  }
}

@keyframes partners__animation {
  0% {transform: translatex(0)};
  100%{transform: translateX(-3500px)};
}

.how-it-works {
  box-sizing: border-box;
  max-width: 1344px;
  margin: 0 auto;
  padding: 0 16px;
}

.sub-title {
  margin: 160px 0 0 0;
  font-weight: 700;
  font-size: 48px;
  line-height: 56px;
  color:$typography-headings;
  @media (max-width: 1200px) {
    margin: 108px 0 0 0;
  }

  @media (max-width: 800px) {
    font-weight: 700;
    font-size: 24px;
    line-height: 32px;
  }
}

.how-it-works-list {
  padding: 0;
  margin-top: 48px;
  list-style-type: none;
}

.how-it-works-list__item {
  display: flex;
  border-bottom: 1px solid $typography-light-gray;
  align-items: center;
  justify-content: space-between;
  @media (min-width: 1200px) {
    &:hover {
      .how-it-works-list__count {
        color: $orange;
      }

      .how-it-works-list__big-text {
        color: $orange;
      }

      .how-it-works-list__text {
        color: $typography-body;
      }
    }
  }

  @media (max-width: 800px) {
    flex-direction: column;
    align-items: flex-start;
  }
}

.how-it-works-list__label {
  display: flex;
  @media (max-width: 1200px) {
    justify-content: space-between;
    flex-direction: column-reverse;
    height: 140px;
  }

  @media (max-width: 800px) {
    flex-direction: row;
    max-height: 33px;
    margin-top: 32px;
  }
}

.how-it-works-list__count {
  margin-right: 37px;
  font-weight: 700;
  font-size: 36px;
  line-height: 48px;
  color: $palette-gray;
  @media (max-width: 1200px) {
    color: $typography-light-gray;
  }

  @media (max-width: 950px) {
    margin-right: 12px;
    font-weight: 700;
    font-size: 24px;
    line-height: 32px;
    color: $typography-gray;
  }
}

.how-it-works-list__big-text {
  font-weight: 700;
  font-size: 36px;
  line-height: 48px;
  color: $palette-gray;
  @media (max-width: 1200px) {
    color: $typography-body;
  }

  @media (max-width: 950px) {
    font-weight: 700;
    font-size: 24px;
    line-height: 32px;
    color: $typography-headings;
  }
}

.how-it-works-list__text {
  max-width: 592px;
  margin: 48px 0;
  font-weight: 400;
  font-size: 16px;
  line-height: 28px;
  color: $typography-gray;
  @media (max-width: 1200px) {
    max-width: 448px;
    color: $typography-dark-gray;
  }

  @media (max-width: 800px) {
    margin: 0 0 32px 0;
    max-width: 328px;
    color: $typography-body;
  }
}

.how-it-works-button {
  display: flex;
  justify-content: center;
  margin-top: 48px;
  &:hover {
    opacity: 0.8;
  }

  @media (max-width: 800px) {
    margin-top: 32px;
  }
}

.button_arrow-right_big {
  display: flex;
  justify-content: space-between;
  width: 300px;
  align-items: center;
  padding: 16px 10px 16px 24px;
  font-weight: 600;
  font-size: 18px;
  line-height: 24px;
  background-color: $orange;
  color: $white;
  border: 1px solid $orange;
}

.count {
  position: relative;
  margin: 0 auto;
  text-align: center;
}

.count__title {
  margin: 200px 0 0 0;
  font-weight: 700;
  font-size: 48px;
  line-height: 56px;
  color: $typography-body;
  @media (max-width: 1200px) {
    margin: 168px 0 0 0;
  }

  @media (max-width: 800px) {
    margin: 172px 0 0 0;
    font-weight: 700;
    font-size: 24px;
    line-height: 32px;
  }
}

.count__text {
  margin: 8px 0 0;
  font-weight: 400;
  font-size: 18px;
  line-height: 32px;
  color: $typography-dark-gray;
  @media (max-width: 800px) {
    margin: 4px 0 0;
    font-weight: 400;
    font-size: 16px;
    line-height: 28px;
  }
}

.count__value {
  display: flex;
  justify-content: space-between;
  align-items: center;
  margin: 64px auto 40px;
  max-width: 404px;
  @media (max-width: 800px) {
    max-width: 272px;
    margin: 32px auto 0;
  }
}

.count__block {
  padding: 20px;
  background-color: $white;
  border-radius: 8px;
  border: 1px solid $white; 
  @media (max-width: 800px) {
    padding: 12px;
  }
}

.count__number {
  margin: 0;
  font-weight: 700;
  font-size: 36px;
  line-height: 48px;
  color: $typography-headings;
  @media (max-width: 800px) {
    font-weight: 700;
    font-size: 24px;
    line-height: 32px;
  }
}

.bubble {
  position: absolute;
  border-radius: 50%;
}

.count_bubble_white {
  z-index: -1;
  left: calc(50% - 98px - 326px);
  top: calc(50% - 98px - 127.38px);
  @media (max-width: 800px) {
    left: calc(50% - 98px - 185px);
    top: calc(50% - 98px - 54px);
  }
}

.count_bubble_orange {
  left: calc(50% - 32px + 179px);
  top: calc(50% - 32px + 9px);
  @media (max-width: 800px) {
    left: calc(50% - 32px + 128px);
    top: calc(50% - 32px + -23px);
  }
}

